import React from 'react';
import '../css/style.css'
import logo from '../img/RMblob.png';
import blog from '../img/RMblob.png';

const Home = () => {
	return (
		<div class="landing-page-container">
			<img src="../img/RM_logo.png" class="landing-page-logo" />

			<p class="landing-page-body">
			Roski Mag is a student run <br />
			publication at the University <br />
			of Southern California. We <br />
			showcase student art and <br />
			design work.
			</p>

			<div class="landing-page-apply">
				<img src={logo} class="landing-page-vector1" />
				<a class="landing-page-apply-link" href="https://roskimag.typeform.com/to/xc4TCO">apply here</a>
			</div>
		</div>
	);
}

export default Home;
